import React from "react";

interface Props {
  uuid: string;
  type: "question" | "answer";
}

const OPActions: React.FC<Props> = ({ uuid, type }) => {
  return (
    <React.Fragment>
      <div className="actions-container">{uuid + type}</div>
    </React.Fragment>
  );
};

export default OPActions;
